import Logo from "../components/Logo";
import Navigation from "../components/Navigation";

const News = () => {
    return (
        <div className="news-container">
            <Navigation/>
            <Logo/>
            <h1>News</h1>
            <input type="text" placeholder="Nom" />
            <textarea placeholder="text"></textarea>
        </div>
    );
};

export default News;
